+	if (set_dest
+	    && code == MATCH_OPERAND
+	    && XSTR (pattern, 2)[0] != '\0'
+	    && XSTR (pattern, 2)[0] != '='
+	    && XSTR (pattern, 2)[0] != '+')
+	  {
+	    message_with_line (pattern_lineno,
+			       "operand %d missing output reload", 
+			       XINT (pattern, 0));
+	    error_count++;
+	  }
+
 	return;
